import React from "react";
import styled from "styled-components";
const UL = styled.table`
    margin: 0;
    padding: 0;
    background-color: ${(props) => (props.isPractice ? "#692692" : "#405cc1")};
    color: white;
    margin: 5px;
    padding: 10px;
    box-shadow: 0px 0px 20px 0px rgba(0, 0, 0, 0.35);
    border-radius: 5px;
    height: 100%;
`;
const P = styled.p`
    font-size: 1.2em;
    margin: 5px 0px;
    font-weight: 700;
`;
const List = ({ isPractice, day, children }) => {
    return (
        <UL isPractice={isPractice}>
            <P>{day}</P>
            <tr>
                <th>Egzamin</th>
                <th>Godzina</th>
                <th>Miejsca</th>
            </tr>
            {children}
        </UL>
    );
};

export default List;
